  p {
    margin: auto;
    padding: auto;
    text-align: center;
  }
`;

function MoveForm() {
  return (
    <MoveFromBlcok>
      <p>31기 지원하기</p>
    </MoveFromBlcok>
  );
}

export default MoveForm;
